import React from "react";
import phone from './img/cards-icons/phone3.png'

const Calculator = () => {
  return (
    <>
    <div id="calculator">

      {/* <!-- Button trigger modal --> */}
      <button
        type="button"
        className="calculator__btn"

      >

       <img src={phone} alt=".."/>
      </button>


    </div>
    </>
  );
};

export default Calculator;
